import React, { useState, useEffect } from 'react';
import { Box, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button, Typography, Toolbar, Dialog, DialogTitle, DialogContent, DialogActions, TextField } from '@mui/material';
import api from '../../services/api';
import Header from '../common/Header';
import Swal from 'sweetalert2';

const CompanyList = () => {
  const [companies, setCompanies] = useState([]);
  const [error, setError] = useState('');
  const [page, setPage] = useState(1);
  const [limit] = useState(10);
  const [totalPages, setTotalPages] = useState(1);
  const [total, setTotal] = useState(0);
  const [openForm, setOpenForm] = useState(false);
  const [form, setForm] = useState({
    dni_company: '',
    name_company: '',
    phone_company: '',
    email_company: '',
    address_company: ''
  });

  useEffect(() => {
    fetchCompanies(page);
  }, [page]);

  const fetchCompanies = async (pageNum = 1) => {
    try {
      const response = await api.get(`/companies?page=${pageNum}&limit=${limit}`);
      if (response.data.state) {
        setCompanies(response.data.data);
        setTotalPages(response.data.pagination.pages);
        setTotal(response.data.pagination.total);
      } else {
        setError(response.data.message);
      }
    } catch (err) {
      setError('Failed to fetch companies');
    }
  };

  const handleFormChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleCreateCompany = async () => {
    try {
      const response = await api.post('/companies', form);
      if (response.data.state) {
        setOpenForm(false);
        setForm({ dni_company: '', name_company: '', phone_company: '', email_company: '', address_company: '' });
        fetchCompanies(page);
        Swal.fire('Éxito', 'Empresa creada correctamente', 'success');
      } else {
        Swal.fire('Error', response.data.message, 'error');
      }
    } catch (err) {
      Swal.fire('Error', 'No se pudo crear la empresa', 'error');
    }
  };

  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
      <Header />
      <Box sx={{ display: 'flex', flexGrow: 1 }}>
        <Box component="main" sx={{ flexGrow: 1, p: 3, overflow: 'auto' }}>
          <Toolbar />
          <Box sx={{ width: '100%', px: 0 }}>
            <Typography variant="h4" gutterBottom>
              Empresas
            </Typography>
            <Button variant="contained" color="primary" sx={{ mb: 2 }} onClick={() => setOpenForm(true)}>
              Crear Empresa
            </Button>
            {error && <Typography color="error">{error}</Typography>}
            <TableContainer component={Paper} sx={{ width: '100%', boxShadow: 3, borderRadius: 2, mb: 2, ml: 0 }}>
              <Table size="medium" sx={{ minWidth: 700 }}>
                <TableHead>
                  <TableRow>
                    <TableCell align="center" sx={{ fontWeight: 'bold', width: 80 }}>ID</TableCell>
                    <TableCell align="center" sx={{ fontWeight: 'bold', width: 160 }}>DNI</TableCell>
                    <TableCell align="center" sx={{ fontWeight: 'bold', width: 180 }}>Nombre</TableCell>
                    <TableCell align="center" sx={{ fontWeight: 'bold', width: 140 }}>Teléfono</TableCell>
                    <TableCell align="center" sx={{ fontWeight: 'bold', width: 200 }}>Email</TableCell>
                    <TableCell align="center" sx={{ fontWeight: 'bold', width: 220 }}>Dirección</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {companies.length === 0 ? (
                    <TableRow>
                      <TableCell colSpan={6} align="center">No hay empresas para mostrar.</TableCell>
                    </TableRow>
                  ) : (
                    companies.map((company) => (
                      <TableRow key={company.id_company} hover>
                        <TableCell align="center">{company.id_company}</TableCell>
                        <TableCell align="center">{company.dni_company}</TableCell>
                        <TableCell align="center">{company.name_company}</TableCell>
                        <TableCell align="center">{company.phone_company}</TableCell>
                        <TableCell align="center">{company.email_company}</TableCell>
                        <TableCell align="center">{company.address_company}</TableCell>
                      </TableRow>
                    ))
                  )}
                </TableBody>
              </Table>
            </TableContainer>
            {/* Paginación */}
            <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', mt: 2 }}>
              <Button
                variant="outlined"
                onClick={() => setPage((prev) => Math.max(prev - 1, 1))}
                disabled={page === 1}
                sx={{ mr: 1 }}
              >
                Anterior
              </Button>
              <Typography sx={{ mx: 2 }}>
                Página {page} de {totalPages} ({total} empresas)
              </Typography>
              <Button
                variant="outlined"
                onClick={() => setPage((prev) => Math.min(prev + 1, totalPages))}
                disabled={page === totalPages}
                sx={{ ml: 1 }}
              >
                Siguiente
              </Button>
            </Box>
            {/* Formulario modal para crear empresa */}
            <Dialog open={openForm} onClose={() => setOpenForm(false)}>
              <DialogTitle>Nueva Empresa</DialogTitle>
              <DialogContent>
                <TextField
                  margin="dense"
                  label="DNI"
                  name="dni_company"
                  value={form.dni_company}
                  onChange={handleFormChange}
                  fullWidth
                  required
                />
                <TextField
                  margin="dense"
                  label="Nombre"
                  name="name_company"
                  value={form.name_company}
                  onChange={handleFormChange}
                  fullWidth
                  required
                />
                <TextField
                  margin="dense"
                  label="Teléfono"
                  name="phone_company"
                  value={form.phone_company}
                  onChange={handleFormChange}
                  fullWidth
                />
                <TextField
                  margin="dense"
                  label="Email"
                  name="email_company"
                  value={form.email_company}
                  onChange={handleFormChange}
                  fullWidth
                />
                <TextField
                  margin="dense"
                  label="Dirección"
                  name="address_company"
                  value={form.address_company}
                  onChange={handleFormChange}
                  fullWidth
                />
              </DialogContent>
              <DialogActions>
                <Button onClick={() => setOpenForm(false)}>Cancelar</Button>
                <Button onClick={handleCreateCompany} variant="contained">Crear</Button>
              </DialogActions>
            </Dialog>
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default CompanyList;
